import React from "react";
import { Link, Typography } from "@mui/material";
import { Box } from "@mui/system";
function MainFooter() {
  return (
    <Box>
    <Typography
    sx={{
       backgroundColor:"secondary.darker"
    }}
    >
      Contact
    </Typography>
    <Typography 
    variant="body2" 
    
    align="center" 
    sx={{
      p:3,
      color:"#fff",
      backgroundColor:"secondary.darker"}}
    >
      {"Copyright @ "}
      <Link color="#fff" href="">
        DinhNgocLienNhi {""}
      </Link>
      {new Date().getFullYear()}
      {"."}
    </Typography>
    </Box>
  );
}

export default MainFooter;
